INSERT INTO `v1_c42f9193bbaccd1fe158f5f7eb1ae26ea5cfa62917a348c7e70a770a54723726` VALUES ("ＴＰダウンカット", "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", "boss_tp_down_cut", 603000406, 76030004);
INSERT INTO `v1_c42f9193bbaccd1fe158f5f7eb1ae26ea5cfa62917a348c7e70a770a54723726` VALUES ("全属性ボーナス特大アップ", "同属性のキャラが４体以上編成されているとき、キャラの属性ボーナスが強化される。", 33, 603000501, 76030005);
INSERT INTO `v1_c42f9193bbaccd1fe158f5f7eb1ae26ea5cfa62917a348c7e70a770a54723726` VALUES ("ダメージ減衰", "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18, 603000502, 76030005);
